  `idUserUpdate` int(11) DEFAULT NULL,
  `qteShop` double DEFAULT NULL,
  `qteStock` double DEFAULT NULL,
  `NEGOTIATEDAMOUNT` double DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `idFournisseur_idx` (`idFournisseur`),
  KEY `idType_Article_idx` (`idType_Article`),
